import styled from "styled-components"
import MainTopNavContainer from "./Components/Container/MainTopNavContainer"

const BackDiv = styled.div`
    width: 100%;
    height: 100%;
`

const UnderDiv = styled.div`
    display:flex;
    align-items: center;
    justify-content: center;

    width: 100%;
    height: 100%;
`

const Main = () => {
    return (
        <BackDiv>
            <MainTopNavContainer />
            <UnderDiv></UnderDiv>
        </BackDiv>
    )
}

export default Main;
